      const heightSlider = document.getElementById('heightSlider');
      const heightValueSpan = document.getElementById('heightValue');

      heightSlider.addEventListener('input', function() {
        currentAltitude = parseFloat(this.value);
        heightValueSpan.textContent = `${currentAltitude.toFixed(1)} m`;
        
        // Perbarui posisi dan orientasi model dengan heading yang tetap
        const newPosition = Cesium.Cartesian3.fromDegrees(initialLon, initialLat, currentAltitude);
        const newOrientation = Cesium.Transforms.headingPitchRollQuaternion(
            newPosition,
            new Cesium.HeadingPitchRoll(fixedHeading, 0, 0)
        );
        modelEntity.position = newPosition;
        modelEntity.orientation = newOrientation;
      });
